const blacklisted = member.data(`${server.id}blacklist`);
if (blacklisted === true) {
    msg.channel.send(`Sorry ${member.displayName}, You're currently blacklisted from using the bot in this server!`);
} else {
    Actions.callNextAction(cache);
}

const moment = this.getWrexMods()
    .require('moment');

const prefix = (server && server.tag) || this.getDBM()
    .Files.data.settings.tag;
const text = msg.content.slice(prefix.length)
    .trim()
    .split(/ +/g);
text.shift();
let infoChan;

if (!text || text.length < 1) {
    infoChan = msg.channel;
} else {
    infoChan = msg.mentions.channels.first() ||
        server.channels.find(c => c.id === `${text.join(' ')}`) ||
        server.channels.find(c => c.name.toLowerCase() === `${text.join(' ').toLowerCase()}`) ||
        server.channels.find(c => c.name.toLowerCase()
            .includes(`${text.join(' ').toLowerCase()}`)) ||
        client.channels.find(c => c.id === `${text.join(' ')}`) ||
        client.channels.find(c => c.name.toLowerCase()
            .includes(`${text.join(' ').toLowerCase()}`));
}
let cCount = this.getVariable(3, "commands", cache);
cCount = Number(cCount) + 1;
this.storeValue(cCount, 3, "commands", cache);
this.getDBM()
    .Files.saveGlobalVariable('commands', cCount);

const then = moment(infoChan.createdAt);
const time = then.from(moment());
const ca = then.format("MMM Do, YYYY");

const embed = new DiscordJS.RichEmbed()
    .setTitle('Channel Information')
    .setColor('RANDOM')
    .setAuthor(msg.member.displayName, msg.author.displayAvatarURL)
    .addField('**Nazwa**', infoChan.name, true)
    .addField('**ID**', infoChan.id, true)
    .addField('**Typ**', infoChan.type, true)
    .addField('**Pozycja**', infoChan.position, true);
if (infoChan.guild != msg.guild) embed.addField('**Server**', infoChan.guild.name, true);
if (infoChan.type == "text") embed.addField('**NSFW**', infoChan.nsfw, true);
if (infoChan.type == "voice") {
    embed.addField('**User Limit**', infoChan.userLimit, true);
    embed.addField('**Bitrate**', infoChan.bitrate, true);
}
embed.addField('**Created At**', `${ca} \n (${time})`, true);
if (infoChan.parent) embed.addField('**Parent**', `${infoChan.parent.name} \n \`${infoChan.parentID}\``, true);
embed.addField('**Mention**', `\`${infoChan}\``, true);
if (infoChan.type == "text") embed.addField('**Topic**', `${(infoChan.topic) || "None"}`, false);
msg.channel.send(embed);
if (me.permissions.has('MANAGE_MESSAGES')) msg.delete();
